import React, { useState } from 'react';

function Header() {

    const [userIconDisplay, setUserIconDisplay] = useState<boolean>(false);

    return (
        <React.Fragment>
        <header>
            <div className='header-content'>
            <p>Microgoogol</p>
            <div className='header-content-right'>
                <button className='userIcon-button' onClick={()=>{setUserIconDisplay(true)}}><img src={require('../../Photos/userIcon.png')} alt='user icon'></img></button>
            </div>
            </div>

            <div className='divider'></div>
        </header>
        </React.Fragment>
    );
}

export default Header;
